BEGIN TRANSACTION;
CREATE TABLE "GH_Product_Category__c" (
	id VARCHAR(255) NOT NULL, 
	"Name" VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE "GH_Product_Line__c" (
	id VARCHAR(255) NOT NULL, 
	"Name" VARCHAR(255), 
	"GH_Product_Type__c" VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE "GH_Product_Type__c" (
	id VARCHAR(255) NOT NULL, 
	"Name" VARCHAR(255), 
	"Type_Code__c" VARCHAR(255), 
	"Product_Category__c" VARCHAR(255), 
	PRIMARY KEY (id)
);
CREATE TABLE "GH_Product__c" (
	id VARCHAR(255) NOT NULL, 
	"Name" VARCHAR(255), 
	"Product_Size__c" VARCHAR(255), 
	"Product_Line__c" VARCHAR(255), 
	PRIMARY KEY (id)
);
COMMIT;
